INSERT INTO `Employees` VALUES (1,'Daniel','Ashbrook','daniel.ashbrook@rit.edu',1,1,'(585) 475-4784','My research is in the area of human-computer interaction, where I concentrate on new interaction techniques, devices, and applications. Historically I have concentrated on wearable and mobile computing, with the goal of allowing people to be less focused on their technology and more engaged with the world, while still reaping the creativity and productivity benefits of their devices. My current research continues this thread while adding a second focus on helping non-experts more easily understand and use personal fabrication technology such as 3D printers, laser cutters, and CNC routers. See my web page or my Google Scholar profile for more information on my research.','â€¢ Ph.D. Computer Science, Georgia Institute of Technology\r\nâ€¢ MS Computer Science, Georgia Institute of Technology\r\nâ€¢ BS Computer Science, Georgia Institute of Technology','',1,'GOL 2615','Assistant Professor',NULL,'./../public/media/userImages/daniel_ashbrook.jpg'),(2,'Catherine','Beaton','catherine.beaton@rit.edu',1,1,'(585) 475-6162','Research interests include Ethics, Accessibility, Human Computer Interaction.','â€¢ B. A., English\r\nâ€¢ B. Ed.\r\nâ€¢ M.I.T.E, Information Technology','â€¢ Hewlett Packard grant on Accessibility\r\nâ€¢ National Science Foundation grant, Speech to Text',1,'GOL 2621','Associate Professor',NULL,'./../public/media/userImages/catherine_beaton.jpg'),(3,'Daniel','Bogaard','dsbics@rit.edu',1,1,'(585) 475-5231','Teaching and research interests include Web-based communication, security, access, and application development - specifically employing emerging technologies. I have been part of numerous research grants, including awards by the National Science Foundation (NSF), National Institutes of Health (NIH), NYS Department of Health, and Rochester General Hospital.\r\n\r\nCurricularly, I oversee all Web related curriculum, the Minor in Web Development for Computing Majors and am very interested in Web Sciences.','â€¢ MS in Information Technology from the Rochester Institute of Technology\r\nâ€¢ BFA in Photography (with Honors) from Indiana University','â€¢ 2011 Eisenhart Award for Outstanding Teaching\r\nâ€¢ Co-PI on NSF grant award-Speech to Text Systems: Comparative Analysis of Text Generation and Display Methods\r\nâ€¢ Co-PI on RGH grant award-Acute Otitis Media Database Project',1,'GOL 2571','Associate Professor - Undergraduate Program Director',NULL,'./../public/media/userImages/daniel_bogaard.jpg'),(4,'Charlie','Border','cbbics@rit.edu',1,1,'(585) 475-7946','MBA and Ph.D., University of Buffalo. Research interests involve the client server model, thin client computing, server virtualization, distributed computing, and security. In conjunction with Profs. Stackpole, Johnson, Pan, and Yuan, Prof. Border has worked to develop the Remote Laboratory Emulation System (RLES) to provide a remotely accessible virtualization environment for local and remote students to accomplish networking and system administration labs similar to our local students.','â€¢ Ph.D.\r\nâ€¢ MBA','',1,'GOL 2329','Associate Professor',NULL,'./../public/media/userImages/charlie_border.jpg'),(5,'Michael','Floeser','Michael.Floeser@rit.edu',1,1,'(585) 475-7031','Michael brings over 25 years and a wide variety of programming, database and Internet experiences to the classroom. Interests are with integrating technologies, programming, and device integration, Geographical Information Systems (GIS), native mode Android programming. Michael has a BT degree in Operating Systems and an MBA in Finance. An example of integrating technologies include data collection and statistical analysis of the engine block assembly line at Buffalo Tonawanda engine plant. Then taking this developed technology and integrating the system to Massena\'s aluminum casting facility. During this project the Equipment Status Language (ESL) was created for General Motors (GM). An object oriented programming language allowing people with minimal programming experience to modify and write new code to adjust for changes in the Programmable Logic Controller (PLC) ladder logic. The end result was graphical displays, telephone based query of information, historical recording and trend analysis, statistical analysis of parts made, and an AI component to predict and warn when tooling will fail to make correct parts.','â€¢ MBA in Finance\r\nâ€¢ BT in Operating Systems','',1,'GOL 2669','Senior Lecturer',NULL,'./../public/media/userImages/michael_floeser.jpg'),(6,'Bryan','French','bdfvks@rit.edu',1,1,'(585) 475-6511','Teaching and research interests include server-side application development and security, native and non-native mobile application development and business application and database development. I am also interested in emerging technologies and how they can be put into practical applications.','â€¢ BA Computer Science SUNY Potsdam\r\nâ€¢ MS Information Technology Rochester Institute of Technology','',1,'GOL 2619','Lecturer',NULL,'./../public/media/userImages/bryan_french.jpg'),(7,'Erik','Golen','efgics@rit.edu',1,1,'','Erik received his PhD in Computing and Information Sciences from RIT in 2009. He has recently worked for Syracuse Research Corporation doing advanced radar signal processing and at BlackBox Biometrics studying potential causes of mild traumatic brain injury. Erik\'s interests include wearable computing, wireless sensor networks, optimization techniques, and bioinformatics.','','â€¢ BS, Computer Engineering, Rochester Institute of Technology\r\nâ€¢ Ph.D., Computing and Information Sciences, Rochester Institute of Technology',1,'GOL 2617','Visiting Assistant Professor',NULL,'./../public/media/userImages/erik_golen.jpg'),(8,'Vicki','Hanson','vlh@rit.edu',1,1,'(585) 475-5384','Dr. Hanson has been working on issues of inclusion throughout her career, first as a Postdoctoral Fellow at the Salk Institute for Biological Studies, then at IBM Research where she founded and managed the Accessibility Research group. At RIT as well as the University of Dundee in Scotland, her research has focused on accessibility of technology for people with disabilities, the aging population, and related research ethics. She is the Vice President of ACM and serves as a member of the ACM Executive Committee and Council, on the ACM-W Europe Executive Committee, and on the ACM Fellows Awards Committee (Chair, 2015). She is Vice President at Large of ACM SIGCHI and an ACM Distinguished Speaker. She has been honored with a Royal Society Research Merit Award, the Anita Borg Woman of Vision Award for Social Impact (2013), the ACM SIGCHI Social Impact Award (2008), and an IBM Corporate Award for Contributions to Accessibility (2009).','â€¢ PhD in Cognitive Psychology, University of Oregon\r\nâ€¢ MA in Cognitive Psychology, University of Oregon\r\nâ€¢ BA, University of Colorado','â€¢ ACM Vice President\r\nâ€¢ Fellow, ACM, for contributions to computing for people with disabilities\r\nâ€¢ Fellow, Royal Society of Edinburgh',1,'GOL 2645','Distinguished Professor',NULL,'./../public/media/userImages/vicki_hanson.jpg'),(9,'Bruce','Hartpence','Bruce.Hartpence@rit.edu',1,1,'(585) 475-7938','Prof. Hartpence teaches classes in wireless communication, routing, switching, troubleshooting and voice over IP. He has authored several networking books for O\'Reilly Publishing. He also runs a youtube channel: http://www.youtube.com/brucehartpence His personal website containing a collection of resources for students and networking pros can be found here: http://www.brucehartpence.com/ A naval veteran, he received his BS, MS, Information Technology from Rochester Institute of Technology. His research interests include wireless communications, Internet backbone, computer telephony and integration.','â€¢ RIT','',1,'GOL 2323','Associate Professor',NULL,'./../public/media/userImages/bruce_hartpence.jpg'),(10,'Larry','Hill','Lawrence.Hill@rit.edu',1,1,'(585) 475-7854','BS, MS, Rochester Institute of Technology. Research interests include programming software process and implementation, electrical hardware design and implementation, software/hardware integration, robotics hardware and software, wireless networking and digital photography. \"I prefer to work with first and second year students to help them adjust to college life during that period , and the academic rigor that follows.\"','','',1,'GOL 2331','Associate Professor - MS HIT Program Coordinator',NULL,'./../public/media/userImages/larry_hill.jpg'),(11,'Ed','Holden','edward.holden@rit.edu',1,1,'(585) 475-5361','BA, Mathematics, SUNY Oswego; MBA, Finance Concentration, Rochester Institute of Technology. Worked in diverse areas of the IT industry for 28 years. Teaching and research interests include programming and database management, data warehousing and cloud computing.\r\n\r\nI am also responsible for the Database Design, Development and Implementation minor.','','',1,'GOL 2655','Associate Professor - MS IST Program Coordinator',NULL,'./../public/media/userImages/ed_holden.jpg'),(12,'Matt','Huenerfauth','matt.huenerfauth@rit.edu',1,1,'(585) 475-2459','For additional information, please visit Matt Huenerfauth\'s homepage, located at http://huenerfauth.ist.rit.edu/.\r\n\r\nOverview\r\nMatt Huenerfauth is an associate professor at the Rochester Institute of Technology (RIT) in the Department of Information Sciences and Technologies. He joined RIT in 2014 after eight years as a faculty member at the City University of New York, where he was a tenured associate professor of computer science and linguistics.\r\n\r\nHis research is in the areas of computer accessibility and assistive technology for people with disabilities, natural language processing (NLP), human computer interaction (HCI), and the computational linguistics of American Sign Language (ASL). His research projects have focused on the design and experimental evaluations of linguistic and assistive technology for people with disabilities, including technology for automatically synthesizing animations of ASL.\r\n\r\nIn addition, he currently serves as the Director of the Linguistic and Assistive Technologies Laboratory (LATLab), Editor-in-Chief of the ACM Transactions on Accessible Computing (TACCESS), which is the major journal in the field of computer accessibility for people with disabilities, and as a member of the steering committee for the ACM SIGACCESS Conference on Computers and Accessibility (ASSETS).','â€¢ Ph.D. (2006) & M.S.E. (2004) in Computer and Information Science from the University of Pennsylvania\r\nâ€¢ M.Sc. (2002) in Computer Science from the University College Dublin, National University of Ireland\r\nâ€¢ M.S. (2001) & Honors B.S. (2001) in Computer and Information Science from the University of Delaware','â€¢ He has secured over $2.1 million in external research funding to support his work, including a National Science Foundation CAREER Award in 2008.\r\nâ€¢ He has written 40 peer-reviewed scientific journal articles, book chapters, and conference papers, and he has twice received the Best Paper Award at the ACM SIGACCESS Conference on Computers and Accessibility, the major computer science conference on assistive technology for people with disabilities.\r\nâ€¢ He served as the general chair for this conference in 2012 and is a member of the steering committee for the conference series. In 2014, he became a Senior Member of the Association for Computing Machinery (ACM).',1,'GOL 2659','Associate Professor - MS HCI Program Coordinator',NULL,'./../public/media/userImages/matt_huenerfauth.jpg'),(13,'Jeff','Jockel','jcjics@rit.edu',1,1,'','With 18 years in the information technology industry, Jeff has worked as a developer, instructor, and a scrum master. He is a graduate of the United States Naval Academy and holds an MS in Software Engineering and an MBA in Finance. Jeff has taught at IBM, the US Naval Academy, and through the Navy\'s \"Navy Campus\" program. His current interests are Angular, NoSQL, Scrum, and anything related to improving the application development life cycle.','','',1,'GOL 2443','Visiting Lecturer',NULL,'./../public/media/userImages/jeff_jockel.jpg'),(14,'Jai','Kang','jai.kang@rit.edu',1,1,'(585) 475-5362','Software Development, Systems Analysis and Design, Programming, Database Management Systems (DBMS), Data Warehousing, Object-Oriented Analysis and Design, Project Management Tools and Methodologies, Operations Research, Environmental Data Modeling/Management, Geographical Information Systems (GIS), Engineering Economics Courseware Development\r\n\r\nOffice Hours: MW 11AM - 1PM','â€¢ Ph.D., Operations Research/Industrial Engineering, State University of New York at Buffalo\r\nâ€¢ MS, Information & Computer Sciences, Georgia Institute of Technology\r\nâ€¢ BS, Seoul National University','',1,'GOL 2651','Associate Professor',NULL,'./../public/media/userImages/jai_kang.jpg'),(15,'Dan','Kennedy','drkisd@rit.edu',1,1,'(585) 475-2811','MS, Information Technology, Rochester Institute of Technology; BS General Studies, Rochester Institute of Technology. PDA Programming, Large-Scale Component Development, Enterprise Application Integration (including database integration and enterprise information architecture), Time-Based Synchronized Multimedia, Game Authoring, XML, VB.NET, Distributed Remediation','','',1,'GOL 2285','Lecturer',NULL,'./../public/media/userImages/dan_kennedy.jpg'),(16,'Deborah','LaBelle','dmlics@rit.edu',1,1,'(585) 475-7854','Deb earned her Ph.D. in Information Science and Technology from Drexel University, Philadelphia PA in 2008. Her research focused on interactions and social motivations of teams in the online learning environment. She is also interested in the study of gender and technology in terms of perspective, use, and representation in the design of new technologies.','â€¢ Ph.D. Information Sciences and Technology\r\nâ€¢ M.A. Mathematics\r\nâ€¢ B.A. Mathematics','â€¢ Office Hours: Monday & Wednesday:12:00 - 2:00PM, or by appointment.',1,'GOL 2627','Lecturer - BS WMC Program Coordinator',NULL,'./../public/media/userImages/deborah_labelle.jpg'),(17,'Jeffery','Lasky','Jeffrey.Lasky@rit.edu',1,1,'(585) 475-2284','Information Architectures, Service Science, Medical Informatics, Enterprise Security','','',1,'GOL 2637','Professor - International Programs Coordinator',NULL,'./../public/media/userImages/jeffrey_lasky.jpg'),(18,'Jim','Leone','jalvks@rit.edu',1,1,'(585) 475-6451','BS, University of Cincinnati, MA, Ph.D. John Hopkins University. His interests include Accreditation, Assessment, and the improvement of the society of Information Technology Educators through SIGITE.\r\n\r\nA bronze partnership with Visual Paradigm gives our students free access to modeling software for modeling and database diagrams and more.  \r\n\r\nVisual Paradigm Academic Partner Program provides Rochester Institute of Technology with the use of modeling software including VP-UML for educational purpose.','â€¢ BS Chemistry, University of Cincinnati\r\nâ€¢ MA Chemistry, Johns Hopkins University\r\nâ€¢ PhE Physical Chemistry, Johns Hopkins University','â€¢ Postdoctoral Research Associate, Radiation Laboratory, Notre Dame',1,'GOL 2657','Professor',NULL,'./../public/media/userImages/jim_leone.jpg'),(19,'Peter','Lutz','Peter.Lutz@rit.edu',1,1,'(585) 475-6162','Dr. Lutz has been at RIT since 1979. In 1991, Dr. Lutz chaired the Information Technology Department when that degree was started, and has since begun new degrees in Applied Networking and System Administration (BS), Information Security and Forensics (BS), and a graduate degree in Networking and System Administration (MS). His interests are in computer networking, programming, and security.','â€¢ B.S., Mathematics, St. John Fisher College, 1973\r\nâ€¢ M.S., Computer Science, SUNY/Buffalo, 1975\r\nâ€¢ Ph.D., Computer Science, SUNY/Buffalo, 1979.','',1,'GOL 2345','Professor',NULL,'./../public/media/userImages/peter_lutz.jpg'),(20,'Sharon','Mason','Sharon.Mason@rit.edu',1,1,'(585) 475-6989','BS, Ithaca College; MS, Rochester Institute of Technology. Her interests include routing and switching, network design, security and management, internetworking and the inclusion and advancement of women in STEM.\r\nProfessor Sharon Mason is an Associate Professor in the Department of Networking, Security and Systems Administration at RIT where she has served on the faculty since 1997. She is the PI for the Department of Defense (DoD) Information Assurance Scholarship Program (IASP) and a 2007 fun','','',1,'GOL 2319','Professor',NULL,'./../public/media/userImages/sharon_mason.jpg'),(21,'Michael','McQuaid','mickmcquaid@gmail.com',1,1,'','','','',1,'GOL 2675','Lecturer - BS HCC Program Coordinator',NULL,'./../public/media/userImages/michael_mcquaid.jpg'),(22,'Tae (Tom)','Oh','Tom.Oh@rit.edu',1,1,'(585) 475-7642','Tae H. Oh received a B.S. degree in Electrical Engineering from Texas Tech University in 1990 and M.S. and Ph.D. degrees in Electrical Engineering from Southern Methodist University (SMU) in 1995 and 2001, respectively.\r\n\r\nBefore joining RIT, he worked for several telecom and defense companies like Raytheon (Communication Systems Engineer: 1990-1995), Nortel Networks (Senior Software Engineer: 1995-1999), Ericsson (Systems Engineer: 1999-2001) and Ceterus Networks (Senior Systems Architect: 2002-2003) and Rockwell Collins (Principle Systems Engineer: 2003-2008) in the area of military communication systems, circuit switching, ATM, MPLS, wireless networks and MANET. He also taught MPLS, IP and Network Management courses at SMU as an adjunct professor (2004-2008).\r\n\r\nHis current research interests include MANET, Sensor Networks, Telemedicine, Network/Cyber Security, Green Communications, and Scalable Modeling and Simulation.','â€¢ PhD in Electrical Engineering (Southern Methodist University)\r\nâ€¢ MS in Electrical Engineering (Southern Methodist University)\r\nâ€¢ BS in Electrical Engineering (Texas Tech University)','â€¢ Research: Mobile Device Security and Forensics, Vehicle Area Networks, Wireless Security Networks, Assistitive Technologies (blind and deaf)',1,'GOL 2281','Associate Professor - MS NSA Program Coordinator',3,'./../public/media/userImages/tae_oh.jpg'),(23,'Sylvia','Perez-Hardy','sylvia.perez-hardy@rit.edu',1,1,'(585) 475-7941','BS, MBA, Cornell University. Sylvia has many years of experience in the field of data communications, computer networking and midrange and large systems management. She joined the RIT faculty in 1998 after her career as a systems engineer at IBM. Her current interests include the use of technology and active learning techniques in teaching, network design, network simulation, network performance, switching, routing, and the interoperability of network devices.','','',1,'GOL 2113','Associate Professor - BS CIT Program Coordinator',NULL,'./../public/media/userImages/sylvia_perezhardy.jpg'),(24,'Nirmala','Shenoy','nxsvks@rit.edu',1,1,'(585) 475-4887','','','',1,'GOL 2303','Professor',NULL,'./../public/media/userImages/nirmala_shenoy.jpg'),(25,'Brian','Tomaszewski','bmtski@rit.edu',1,1,'(585) 475-2869','â€¢ Geographic Information Science and Technology (GIS&T)\r\nâ€¢ Geovisual Analytics\r\nâ€¢ Geographic Information Retrieval\r\nâ€¢ Context Modeling and Representation\r\nâ€¢ Geocollaboration\r\nâ€¢ Crisis Management\r\nâ€¢ Humanitarian Information Management','â€¢ Ph.D. - Geography, Penn State, 2008','',1,'GOL 2673','Assistant Professor',NULL,'./../public/media/userImages/brian_tomaszewski.jpg'),(26,'Ronald','Vullo','rpv@mail.rit.edu',1,1,'(585) 475-7281','My early research in hypertext and multimedia learning environments has evolved over the years into my current work with dynamic database-backed web sites and web applications. I am currently creating an XML syntax as an abstraction layer on top of the programming and database work that makes such sites possible. Connected to this work on the web is an interest in online communities and the virtual worlds they represent. I have also been bringing this development to bear in support of new platforms such as the Apple iPad.\r\n\r\nFor much of my career I have been involved in medical and dental informatics. Much of that work has led to issues of visualization and user interface and interaction design. I direct an ongoing open source electronic health record effort called Project Galen which is a natural outgrowth of pioneering efforts of mine throughout my pre-RIT career. I also have a strong background and interest in using technology as a tool for education. I\'\'ve also done research connected to the accessibility of technology to those with disabilities, as well as taking advantage of new technologies to assist them.\r\n\r\nI am faculty advisor to the Minor in Web Design and Development I created for non-computing majors and in connection with that I\'ve expanded my efforts in digital imaging and video.','â€¢ B.S. in Biology, LeMoyne College, 1981\r\nâ€¢ Ed.M. in Science Education, University at Buffalo, 1985\r\nâ€¢ Ph.D. in Science Education/Instructional Software Design, University at Buffalo, 1991','',1,'GOL 2519','Associate Professor - Web Design and Development',NULL,'./../public/media/userImages/ronald_vullo.jpg'),(27,'Elissa','Weeden','emwics@rit.edu',1,1,'(585) 475-6733','BS, MS, Rochester Institute of Technology. Her areas of expertise are in database design and implementation as well as applications programming. She consults professionally and regularly within those areas. Her research and teaching interests include: applications programming, interface designs, needs assessment, data modeling, and database administration.','','',1,'GOL 2635','Associate Professor',NULL,'./../public/media/userImages/elissa_weeden.jpg'),(28,'Qi','Yu','qyuvks@rit.edu',1,1,'(585) 475-6929','Qi Yu received his Ph.D. from the Department of Computer Science at Virginia Tech, Blacksburg, VA, M.E. from National University of Singapore, Singapore, and B.S. from Zhejiang University, Hangzhou, China.\r\n\r\nResearch Interest\r\nLarge-scale data management and analytics, with an emphasis on developing fundamental data mining and machine learning models and algorithms that can be used to analyze massive modern data collections generated from diverse domains, such as service-oriented Big data (QoS and service description data), uncertain data (e.g., sensor and GPS data), and large-scale unstructured data (e.g., images and text).','â€¢ PhD, Virginia Tech\r\nâ€¢ MS, National University of Singapore\r\nâ€¢ BE, Zhejiang University','',1,'GOL 2669','Associate Professor - Graduate Program Director',NULL,'./../public/media/userImages/qi_yu.jpg'),(29,'Steve','Zilora','sjzics@rit.edu',1,1,'(585) 475-7643','Interest areas include the software development process, database applications, and Informatics.','â€¢ BS, Chemical Engineering, University of Rochester\r\nâ€¢ MS, Computer Science, NJ Institute of Technology','',1,'GOL 2109','Associate Professor - Department Chair',NULL,'./../public/media/userImages/steve_zilora.jpg'),(30,'Rhonda','Baker-Smith','rdbcst@rit.edu',1,0,'(585) 475-7924','','','',1,'GOL 2103','IST Office Manager',NULL,'./../public/media/userImages/rhonda_bakersmith.jpg'),(31,'Melissa','Hanna','mchics@rit.edu',1,0,'(585) 475-6179','','','',1,'GOL 2120','Senior Staff Assistant',NULL,'./../public/media/userImages/melissa_hanna.jpg'),(32,'Betty','Hillman','echics@rit.edu',1,0,'(585) 475-2700','am the primary academic advisor for the Undergraduate Networking and Systems Administration program, and also a backup advisor for students in the Information Technology program. Advisors help students in course selection, long-term planning, policies and procedures, and what resources are available to them on campus. We tend to be a student\'s first contact point for most issues; if we don\'t know the answer, we know who on campus will. All IST advisors are generally available via appointment (by calling 585-475-2700), or by email.\r\n\r\nI have been at RIT for 17 years in a number of capacities, and a RIT Alumna. Keeping active and learning new things is what I love most - hiking (I have hiked 8 of the 46 Adirondack High Peaks), going to the gym, jogging with my crazy dog, taking computing classes (some for non-computing majors), and playing volleyball are some of my favorite things to do.','â€¢ M.S. Human Resource Development, RIT\r\nâ€¢ B.A, Multidisciplinary Studies: RIT','',1,'GOL 2126','Academic Advisor',2,'./../public/media/userImages/betty_hillman.jpg'),(33,'Matt','Lake','Matt.Lake@rit.edu',1,0,'(585) 475-2700','I advise students in the Information Technology program, and am a backup advisor for the Networking and System Administration program. I am also the primary advisor for IST students in the Honors program. I have been at RIT since April 2010; previously, I worked in Residential Life at St. John Fisher College. Advisors help students in course selection, long-term planning, policies and procedures, and what resources are available to them on campus. We tend to be a student\'s first contact point for most issues; if we don\'t know the answer, we know who on campus will. All IST advisors are available via appointment (by calling 585-475-2700 or stopping by Golisano 2121) or by email.','â€¢ 2006: M.Ed., Counseling in Student Affairs- University of California, Los Angeles\r\nâ€¢ 2003: B.A. History, Secondary Education- St. John Fisher College','',1,'GOL 2121','Senior Academic Advisor - Information Technology; Honors',NULL,'./../public/media/userImages/matt_lake.jpg'),(34,'Mark','Lessard','mark@it.rit.edu',1,0,'(585) 475-2321','','','',1,'GOL 2350','Technician',2,'./../public/media/userImages/mark_lessard.jpg'),(35,'Jimmy','McNatt','jdmics@rit.edu',1,0,'(585) 475-7931','','','',1,'GOL 2351','Systems Administrator',NULL,'./../public/media/userImages/jimmy_mcnatt.jpg'),(36,'Matt','Noble','manics@rit.edu',1,0,'(585) 475-4302','As the newest member of the IST staff, Matt is responsible for department communications, community outreach, and student event planning. He also oversees the IST Student Ambassador program.','â€¢ MA Public Relations, University of Miami\r\nâ€¢ BA English, University at Buffalo','',1,'GOL 2107','Student Experience Coordinator',NULL,'./../public/media/userImages/matt_noble.jpg'),(37,'Jill','Persson','jmpics@rit.edu',1,0,'(585) 475-5038','','','',1,'GOL 2121','Graduate Academic Advisor',3,'./../public/media/userImages/jill_persson.jpg'),(38,'Theresa','Pozzi','theresa@it.rit.edu',1,0,'(585) 475-7321','','','',1,'GOL 2122','Senior Staff Specialist',NULL,'./../public/media/userImages/theresa_pozzi.jpg'),(39,'John','Simonson','jssics@rit.edu',1,0,'','','','',1,'GOL 2349','Infrastructure Systems Admin',NULL,'./../public/media/userImages/john_simonson.jpg'),(40,'David','Schwartz','disvks@rit.edu',1,1,'(585) 475-5521','','','',2,'GOL 2157','Associate Professor - Director of IGM',NULL,'./../public/media/userImages/david_schwartz.jpg'),(41,'Jessica','Bayliss','jdbics@rit.edu',1,1,'(585) 475-2507','','','',2,'GOL 2153','Associate Professor - Associate Director',NULL,'./../public/media/userImages/jessica_bayliss.jpg'),(42,'Kevin','Bierre','kjbics@rit.edu',1,1,'(585) 475-5358','','','',2,'GOL 2535','Associate Professor',NULL,'./../public/media/userImages/kevin_bierre.jpg'),(43,'Al','Biles','mark@rit.edu',1,1,'(585) 475-4149','','','',2,'GOL 2559','Professor',NULL,'./../public/media/userImages/al_biles.png'),(44,'Alberto','Bobadilla Sotelo','labigm@rit.edu',1,1,'(585) 475-4391','','','',2,'GOL 2555','Lecturer',NULL,'./../public/media/userImages/alberto_sotelo.jpg'),(45,'Sean','Boyle','seaboy@mail.rit.edu',1,1,'(585) 475-4517','','','',2,'GOL 2517','Lecturer',NULL,'./../public/media/userImages/sean_boyle.jpg'),(46,'Christopher','Cascioli','cdccis@rit.edu',1,1,'(585) 475-2533','','','',2,'GOL 2503','Lecturer',NULL,'./../public/media/userImages/christopher_cascioli.jpg'),(47,'Erin','Cascioli','